import React from 'react';
import './'

function HomePage() {
  return (
    <div>
      {/* Navbar */}
      <nav className="custom-navbar navbar navbar-expand-lg navbar-dark fixed-top">
        {/* Contenido del Navbar */}
      </nav>

      {/* Header */}
      <header id="home" className="header">
        <div className="overlay text-white text-center">
          <h1 className="display-2 font-weight-bold my-3">Food Hut</h1>
          <h2 className="display-4 mb-5">Always fresh &amp; Delightful</h2>
          <a className="btn btn-lg btn-primary" href="#gallary">View Our gallary</a>
        </div>
      </header>

      {/* Acerca de */}
      <div id="about" className="container-fluid wow fadeIn">
        {/* Contenido de Acerca de */}
      </div>

      {/* Galería */}
      <div id="gallary" className="text-center bg-dark text-light has-height-md middle-items wow fadeIn">
        {/* Contenido de Galería */}
      </div>
      <div className="gallary row">
        {/* Contenido de las imágenes de la galería */}
        <img src="./Components/assets/gallary-1.jpg" alt="Gallary 1" className="gallary-img" />
        {/* Otras imágenes de la galería */}
      </div>

      {/* Reservar una mesa */}
      <div className="container-fluid has-bg-overlay text-center text-light has-height-lg middle-items" id="book-table">
        {/* Contenido de Reservar una mesa */}
      </div>

      {/* Blog */}
      <div id="blog" className="container-fluid bg-dark text-light py-5 text-center wow fadeIn">
        {/* Contenido de Blog */}
      </div>

      {/* Testimonios */}
      <div id="testmonial" className="container-fluid wow fadeIn bg-dark text-light has-height-lg middle-items">
        {/* Contenido de Testimonios */}
      </div>

      {/* Contacto */}
      <div id="contact" className="container-fluid bg-dark text-light border-top wow fadeIn">
        {/* Contenido de Contacto */}
      </div>

      {/* Footer */}
      <div className="container-fluid bg-dark text-light has-height-md middle-items border-top wow fadeIn">
        {/* Contenido de Footer */}
      </div>
      <div className="bg-dark text-light text-center border-top wow fadeIn">
        {/* Contenido adicional de Footer */}
      </div>

      {/* Importación de recursos de assets */}
      <script src="./path/to/jquery-3.4.1.js"></script>
      <script src="./path/to/bootstrap.bundle.js"></script>
      <script src="./path/to/wow.js"></script>
      <script async defer src="https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&callback=initMap"></script>
      <script src="./path/to/foodhut.js"></script>
    </div>
  );
}

export default HomePage;
